import React from "react";
import "./App.css";
import { Card, Button } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
function App() {
  return (
    <div className="app">
      <header className="App-header"></header>
      <Card border="primary">
        <h1>This is card</h1>
        <Button variant="secondary" size="sm">
          {" "}
          Sample
        </Button>
      </Card>
    </div>
  );
}

export default App;
